column8:
スポーティーにドレスアップ！貼り方は自由自在<br><br>
●カーボンをリアルに再現した、高耐候のドレスアップシートです。<br>
●2ラインのスポーティーなデザインでボディーをドレスアップ出来ます。<br>
●伸びる素材で曲面にも貼れ、『表面アプリケーションフィルム』付で<br>2ライン（太いラインと細いライン）の間隔や平行を均等に保ちながら、一度にキレイに貼ることができます。<br><br><br>
<u>Mサイズ</u><br>
ボンネットに最適！<br><br>
カラー：ブラック／シルバー／ガンメタ<br><br>

≪商品サイズ≫<br>
本体：H1350×W225mm<br>
パッケージ：H298×W92×D92mm<br><br>
※ご注意<br>
本商品をお買い求めになる前に<br>
・貼り付けたい箇所の寸法（1.5～2mの巻き込み部分を含む）を測り、製品サイズと合うか確認してください。<br>
・曲面がきつい部分や複雑な形状へは対応できない場合があります。<style type="text/css">
